CREATE PROCEDURE [dbo].[GetRecruiters]  (@companyID INT)
              
as              
begin              
              
SELECT ID, NAME+' '+LastName FNAME FROM Recruiters
WHERE ID_COMPANY = @companyID
ORDER BY Name

end
