-- ----------------------------
-- Procedure structure for GetBatchesList
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetBatchesList]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetBatchesList]
GO

CREATE PROCEDURE [dbo].[GetBatchesList]  
(              
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100)              
)              
as              
begin              
              
DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT              
              
declare @temp table (RowNo int,ID int,PositionId int,BatchStartDt date,EvaluationDt date,  
 Active bit,Title varchar(100), TotProfiles int,Offer int,FirstDayShowup int,ApperedInEval int,OfferEval int,LeftOffice int, BatchName varchar(100))  
              
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                              
SET @LastRec = ( @pageNum * @PageSize ) + 1;              
              
insert into @temp (RowNo,ID,PositionId,BatchStartDt,EvaluationDt,Active,Title,TotProfiles,Offer,FirstDayShowup,ApperedInEval,OfferEval,LeftOffice,BatchName)              
select ROW_NUMBER() OVER(ORDER BY bl.BatchStartDt DESC), bl.Id,bl.PositionId,bl.BatchStartDt,bl.EvaluationDt,bl.Active,p.Title,    
(SELECT COUNT(*) FROM Profile_users where BatchId=bl.Id),(SELECT COUNT(*) FROM Profile_users where BatchId=bl.Id and Offer=1),  
(SELECT COUNT(*) FROM Profile_users where BatchId=bl.Id and FirstDayShowup=1), 
(SELECT COUNT(*) FROM Profile_users pu inner join Evalution e on e.Profile_users_PID=pu.PID where pu.BatchId=bl.Id and e.AppearedInEval=1), 
(SELECT COUNT(*) FROM Profile_users pu inner join Evalution e on e.Profile_users_PID=pu.PID where pu.BatchId=bl.Id  and e.AppearedInEval=1 and e.Selected=1 and pu.LeftOffice=0),        
(SELECT COUNT(*) FROM Profile_users pu inner join Evalution e on e.Profile_users_PID=pu.PID where pu.BatchId=bl.Id  and e.AppearedInEval=1 and e.Selected=1 and pu.LeftOffice=1),
p.Title+' '+CONVERT(VARCHAR(10),BatchStartDt,3) AS BatchName


from BatchList bl inner join Positions p on bl.PositionId=p.Id and bl.Active=1  
where ((p.Title like '%'+@SearchText+'%') or (convert(varchar(10),bl.BatchStartDt,101)=@SearchText)) order by BatchStartDt desc          
              
SELECT ID,PositionId,BatchStartDt,EvaluationDt,Title,Active,(SELECT COUNT(*) FROM @temp) AS TotalCount,TotProfiles,    
Offer AS TotalProfileAccepted,FirstDayShowup as TotIn,ApperedInEval,OfferEval,LeftOffice,  Title+' '+ CONVERT(VARCHAR(10),BatchStartDt,3) AS BatchName 
FROM @temp WHERE RowNo > @FirstRec AND RowNo < @LastRec                  
              
end
GO


