-- Procedure structure for GetPlacementList
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetPlacementList]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetPlacementList]
GO

CREATE PROCEDURE [dbo].[GetPlacementList]
(            
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100)            
) 
as
begin
      
DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT            
      
declare @Temp table (BatchId int, Technology varchar(100),PID int,PFullName varchar(100),PMarketingId int)

declare @Final table (RowNo int identity(1,1),BatchId int, Technology varchar(100),PID int,PFullName varchar(100),PMarketingId int,
	StartDt date,Marketer varchar(100),TotalInterviews int)
           
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                            
SET @LastRec = ( @pageNum * @PageSize ) + 1;            

insert into @Temp (BatchId,Technology,PID,PFullName,PMarketingId)
select b.Id,po.Title, p.PID, (p.Fname + ' ' + p.LName) as PFullName,min(pm.Id) as PMarketingId 
from BatchList b inner join Profile_users p on b.Id=p.BatchId
inner join Positions po on po.Id=b.PositionId
inner join ProfileMarketing pm on p.PID=pm.Profile_users_PID and Placed=0
where p.LeftOffice=0 and p.PID not in (select p1.PID from Profile_users p1 inner join ProfileMarketing m1 on m1.Profile_users_PID=p1.PID and m1.Placed=1)
group by b.Id,po.Title,p.PID,p.Fname,p.LName

insert into @Final (BatchId,Technology,PID,PFullName,PMarketingId,StartDt,Marketer,TotalInterviews)
select BatchId,Technology,PID,PFullName,PMarketingId,
pm.StartDt,u.FullName as Marketer, (select count(*) from ProfileClientInterview where ProfileUserId=t.PID) as TotalInterviews
from @Temp t 
inner join ProfileMarketing pm on t.PMarketingId=pm.Id
inner join Users u on u.ID=pm.SalesTeamId
where ((PFullName like '%'+@SearchText+'%') or (u.FullName like '%'+@SearchText+'%') or (Technology like '%'+@SearchText+'%'))

select BatchId,Technology,PID,PFullName,PMarketingId,StartDt,Marketer,TotalInterviews,(select count(*) from @Final) as TotalCount from @Final
 WHERE RowNo > @FirstRec AND RowNo < @LastRec 

end
GO


