IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetPositionList]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetPositionList]
GO

CREATE PROCEDURE [dbo].[GetPositionList]  --1,10,'',''
(            
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100)            
)            
as            
begin            
            
DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT            
            
declare @temp table (RowNo int,ID int,Title varchar(50),Active bit)
            
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                            
SET @LastRec = ( @pageNum * @PageSize ) + 1;            
            
insert into @temp (RowNo,ID,Title,Active)            
select ROW_NUMBER() OVER(ORDER BY p.Id DESC), p.Id,p.Title,p.Active     
from Positions p 
where p.Title like '%'+@SearchText+'%' order by p.Id         
            
SELECT ID,Title,Active,(SELECT COUNT(*) FROM @temp) AS TotalCount
FROM @temp WHERE RowNo > @FirstRec AND RowNo < @LastRec                
            
end
GO


