CREATE PROCEDURE [dbo].[GetProfileEvaluation]
(@PId int=null)
as
begin

select e.*,r.Reason from Evalution e 
left join ReasonForNotSelecting r on e.reasonForNotSelectingId=r.Id
where e.Profile_users_PID=@PId

end
GO


