CREATE PROCEDURE [dbo].[getProfileList]           
(              
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100),@BatchId int,@Filter int              
)              
as              
begin              
              
 DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT      
              
declare @temp table (RowNo int,PID int,Fname varchar(50),LName varchar(50),Contact varchar(20),Email varchar(100),FirstDayShowup bit,      
SecondDayShowup bit,ThirdDayShowup bit,FouthDayShowup bit,FifthDayShowup bit,SixthDayShowup bit,SeventhDayShowup bit,EightDayShowup bit,      
NinthDayShowup bit,TenthDayShowup bit,SalStartDt varchar(50),EvalSelected bit,LeftOffice bit)              
              
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                              
SET @LastRec = ( @pageNum * @PageSize ) + 1;              
    
if(@Filter=1)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select DISTINCT ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p left join Evalution e on p.PID=e.Profile_users_PID   
 where p.BatchId=@BatchId and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end    
else if(@Filter=2)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p left join Evalution e on p.PID=e.Profile_users_PID   
 where p.BatchId=@BatchId and p.Offer=1 and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end    
else if(@Filter=3)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p left join Evalution e on p.PID=e.Profile_users_PID   
 where p.BatchId=@BatchId and p.FirstDayShowup=1 and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end    
else if(@Filter=4)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1     
 where p.BatchId=@BatchId and p.FirstDayShowup=1 and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end    
else if(@Filter=5)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1 and e.Selected=1 and p.LeftOffice=0     
 where p.BatchId=@BatchId and p.FirstDayShowup=1 and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end  
else if(@Filter=6)    
begin    
 insert into @temp (RowNo,PID,Fname,LName,Contact,Email,FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,      
  SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,SalStartDt,EvalSelected,LeftOffice)              
 select ROW_NUMBER() OVER(ORDER BY CASE WHEN @SortExp = 'FName_Asc' THEN p.Fname END ASC, CASE WHEN @SortExp = 'FName_Desc'THEN p.Fname END DESC, CASE WHEN @SortExp = 'LName_Asc' THEN p.LName END ASC,     
  CASE WHEN @SortExp = 'LName_Desc'THEN p.LName END DESC,  CASE WHEN @SortExp = 'Contact_Asc' THEN p.Contact END ASC, CASE WHEN @SortExp = 'Contact_Desc'THEN p.Contact END DESC,     
  CASE WHEN @SortExp = 'Email_Asc' THEN p.Email END ASC, CASE WHEN @SortExp = 'Email_Desc'THEN p.Email END DESC, CASE WHEN isnull(@SortExp,'') = '' THEN p.Fname+' '+p.LName END ASC)[RowNo],            
  p.PID,Fname,p.LName,p.Contact,p.Email,p.FirstDayShowup,p.SecondDayShowup,p.ThirdDayShowup,p.FouthDayShowup,p.FifthDayShowup,p.SixthDayShowup,p.SeventhDayShowup,      
 p.EightDayShowup,p.NinthDayShowup,p.TenthDayShowup,(case when p.SalStartDt is null then 'Not Yet' else (convert(varchar(10),p.SalStartDt,101)+' ($'+convert(varchar(20),p.Salary)+')') end),
 isnull(e.Selected,0),p.LeftOffice
 from Profile_users p inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1 and e.Selected=1 and p.LeftOffice=1     
 where p.BatchId=@BatchId and p.FirstDayShowup=1 and ((p.Fname like '%'+@SearchText+'%') or (p.LName like '%'+@SearchText+'%'))          
end    
    
SELECT PID,Fname,LName,Contact,Email,(SELECT COUNT(*) FROM @temp) AS TotalCount,isnull(FirstDayShowup,0) as attended,      
 isnull(SecondDayShowup,0) as SecondDayShowup,isnull(ThirdDayShowup,0) as ThirdDayShowup,isnull(FouthDayShowup,0) as FouthDayShowup,      
 isnull(FifthDayShowup,0) as FifthDayShowup,isnull(SixthDayShowup,0) as SixthDayShowup,isnull(SeventhDayShowup,0) as SeventhDayShowup,      
 isnull(EightDayShowup,0) as EightDayShowup,isnull(NinthDayShowup,0) as NinthDayShowup,isnull(TenthDayShowup,0) as TenthDayShowup,SalStartDt,EvalSelected,LeftOffice            
   FROM @temp WHERE RowNo > @FirstRec AND RowNo < @LastRec                  
              
end
GO


