-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetReasonList]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetReasonList]
GO

CREATE PROCEDURE [dbo].[GetReasonList] 
(            
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100)            
)            
as            
begin            
            
DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT            
            
declare @temp table (RowNo int,ID int,Reason varchar(100),Active bit)
            
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                            
SET @LastRec = ( @pageNum * @PageSize ) + 1;            
            
insert into @temp (RowNo,ID,Reason,Active)            
select ROW_NUMBER() OVER(ORDER BY r.Id DESC), r.Id,r.Reason,r.Active     
from ReasonForNotSelecting r 
where r.Reason like '%'+@SearchText+'%' order by r.Id         
            
SELECT ID,Reason,Active,(SELECT COUNT(*) FROM @temp) AS TotalCount
FROM @temp WHERE RowNo > @FirstRec AND RowNo < @LastRec                
            
end
GO


