	DROP PROCEDURE[dbo].[GetUsersList]
GO

CREATE PROCEDURE [dbo].[GetUsersList]  
(              
@pageNum INT,@pageSize INT,@SortExp VARCHAR(50),@SearchText VARCHAR(100)              
)              
as              
begin              
              
DECLARE @FirstRec INT,@LastRec INT,@TotalRecords INT              
              
declare @temp table (RowNo int,ID int,FullName varchar(50),password varchar(50),Email varchar(50),username varchar(50),
	Roles_id int,ActiveInactive bit,LastLoginDate datetime,RoleName varchar(50))
              
SET @FirstRec = ( @pageNum - 1 ) * @PageSize                                              
SET @LastRec = ( @pageNum * @PageSize ) + 1;              
              
insert into @temp (RowNo,ID,FullName,password,Email,username,Roles_id,ActiveInactive,LastLoginDate,RoleName)
select ROW_NUMBER() OVER(ORDER BY u.FullName), u.ID,u.FullName,u.password,u.Email,u.username,u.Roles_id,u.ActiveInactive,u.LastLoginDate,r.name       
from Users u inner join Roles r on u.Roles_id=r.ID
where (u.FullName like '%'+@SearchText+'%') order by u.FullName
              
SELECT ID,FullName,password,Email,username,Roles_id,ActiveInactive,LastLoginDate,RoleName,(SELECT COUNT(*) FROM @temp) AS TotalCount   
FROM @temp WHERE RowNo > @FirstRec AND RowNo < @LastRec                  
              
end
GO


