	DROP PROCEDURE[dbo].[GetBatchCandidates]
GO

CREATE PROCEDURE [dbo].[GetBatchCandidates]  (@batchID INT)
              
as              
begin              
              
select DISTINCT Fname, LName, Contact, Profile_users.Email, Profile_users.Address, Education.Education, Applied_Via, CONVERT(DATETIME,convert(varchar, created_On, 0),102) created_On, SkypeID, Birthday,VisaHelp, SexTypeID, Gender_Types.GENDER Gender, RecruiterID, Recruiters.Name+' '+Recruiters.LastName Recruiter, BackgroundCheck, AccommodationHelp, ExperienceYears, NationalityStatus, Profile_users.CodingExperienceBefore,TaughtMyselfCoding,AttendedComputerBootCamp,StudiedCodingCollege,LiberalArtsBackground,ScienceBackground,StudiedOnlineCodeCamp,StudiedW3Schools,StudiedYoutubeVideos,ResearchStackOverFlow,StudiedOnlineUdemy,PracticedAlgorithms,GoogleAnswers,NoExperience, COMPANY_NAME, Positions.Title+' '+CONVERT(VARCHAR(10),BatchStartDt,3) as Title, BatchStartDt StartDate, Positions.Title Position, TrainingMode, CriminalRecords, Country, WillingToRelocate, VisaStatus

from Profile_users

LEFT OUTER JOIN Recruiters ON Recruiters.ID = Profile_users.RecruiterID
LEFT OUTER JOIN Gender_Types ON Gender_Types.ID = Profile_users.SexTypeID
LEFT OUTER JOIN UserCodingExperience ON UserCodingExperience.UserID = Profile_users.PID
LEFT OUTER JOIN Companies ON Companies.ID_COMPANY = Recruiters.ID_COMPANY
LEFT OUTER JOIN BatchList ON BatchList.ID = Profile_users.BatchId
INNER JOIN Positions ON Positions.ID = BatchList.PositionId
LEFT OUTER JOIN Countries On Countries.CountryID = Profile_users.CountryID
LEFT OUTER JOIN Education ON Education.EducationID = Profile_users.EducationID
LEFT OUTER JOIN VisaStatus ON VisaStatus.VisaStatusID = Profile_users.VisaStatusID



WHERE Profile_users.BatchId = @batchID
ORDER BY Fname
end
GO


