-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[getDashBoard]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[getDashBoard]
GO

CREATE PROCEDURE [dbo].[getDashBoard]
as
begin

declare @InEval int,@SelTrain int,@ClientPlaced int,@InMarket int

--select @InEval=count(p.PID) from profile_users p inner join BatchList bl on bl.Id=p.BatchId and bl.EvaluationDt<getdate() and p.FirstDayShowup=1
SELECT @InEval=COUNT(*) FROM Profile_users pu inner join Evalution e on e.Profile_users_PID=pu.PID where e.AppearedInEval=1 and e.Selected=1 and pu.LeftOffice=1

select @SelTrain=count(p.PID) from Profile_users p inner join Evalution e on e.Profile_users_PID=p.PID and e.AppearedInEval=1 and e.Selected=1 
left join ProfileMarketing m on p.PID=m.Profile_users_PID where m.id is null and p.LeftOffice=0

select @InMarket=count(*) from (
select distinct p.PID from Profile_users p inner join ProfileMarketing m on m.Profile_users_PID=p.PID and m.Placed=0 and p.LeftOffice=0
where p.PID not in (select p1.PID from Profile_users p1 inner join ProfileMarketing m1 on m1.Profile_users_PID=p1.PID and m1.Placed=1)
) as a

select @ClientPlaced=count(p.PID) from Profile_users p inner join ProfileMarketing m on m.Profile_users_PID=p.PID and m.Placed=1

select isnull(@InEval,0) as InEval,isnull(@SelTrain,0) as SelTrain,isnull(@ClientPlaced,0) as ClientPlaced,isnull(@InMarket,0) as InMarket

end
GO


