-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetAttendanceReport]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetAttendanceReport]
GO

CREATE PROCEDURE [dbo].[GetAttendanceReport]  --'12/12/2017','12/12/2017',null
( @StartDt date, @EndDt date, @Tech int=null )  
as  
begin  

declare @NoofWkDays int
set @NoofWkDays=0
set @NoofWkDays= ((DATEDIFF(dd, @StartDt, @EndDt) + 1)-(DATEDIFF(wk, @StartDt, @EndDt) * 2)-(CASE WHEN DATENAME(dw, @StartDt) = 'Sunday' THEN 1 ELSE 0 END)
					-(CASE WHEN DATENAME(dw, @EndDt) = 'Saturday' THEN 1 ELSE 0 END))

select @NoofWkDays=@NoofWkDays-count(*) from HolidayList where HDate between @StartDt and @EndDt
  
select *,'Attended'=(select count(*) from TraineeAttendance where Dt between @StartDt and @EndDt and Absent=0 and ProfileId=PID),  
'NotAttended'=(select @NoofWkDays-count(*) from TraineeAttendance where Dt between @StartDt and @EndDt and Absent=0 and ProfileId=PID)   
from (  
select p.PID,(p.Fname+' '+p.LName) as pName,po.Title,b.BatchStartDt from Profile_users p inner join BatchList b on p.BatchId=b.Id and p.FirstDayShowup=1  
inner join Positions po on b.PositionId=po.Id and po.Id=COALESCE(@Tech,po.Id)  
inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1 and e.Selected=1  
left join ProfileMarketing pm on p.PID=pm.Profile_users_PID and Placed=0 where pm.id is null  
union all  
select p.PID,(p.Fname+' '+p.LName) as pName,po.Title,min(b.BatchStartDt) as BatchStartDt  
from Profile_users p inner join BatchList b on p.BatchId=b.Id and p.FirstDayShowup=1  
inner join Positions po on b.PositionId=po.Id and po.Id=COALESCE(@Tech,po.Id)  
inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1 and e.Selected=1  
inner join ProfileMarketing pm on p.PID=pm.Profile_users_PID and Placed=0  
group by p.PID,p.Fname,p.LName,po.Title  
) as a order by pName  
  
end
GO


