-- Procedure structure for getGrossMarginRpt
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[getGrossMarginRpt]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[getGrossMarginRpt]
GO

CREATE PROCEDURE [dbo].[getGrossMarginRpt]
(@StartDt date,@EndDt date,@Flag int)
as
begin

declare @temp table
(PID int, pName varchar(100),Title varchar(50),SalStartDt date,MarketingStartDt date,MarketingId int)

insert into @temp
select p.PID,(p.Fname+' '+p.LName) as pName,po.Title,p.SalStartDt,min(pm.StartDt) as MarketingStartDt,isnull(max(pm.Id),0) as MarketingId 
from Profile_users p inner join BatchList b on p.BatchId=b.Id and p.FirstDayShowup=1
inner join Positions po on b.PositionId=po.Id 
inner join Evalution e on p.PID=e.Profile_users_PID and e.AppearedInEval=1 and e.Selected=1
left join ProfileMarketing pm on p.PID=pm.Profile_users_PID 
group by p.PID,p.Fname,p.LName,po.Title,p.SalStartDt
order by pid

if(@Flag=1)
begin
	select distinct * from (
	select t.*,pm.ProjectStartDt,0 as TotCompensation,pm.HourlyRate,(pm.HourlyRate*80) as TotconsultingFee from @temp t
	inner join ProfileMarketing pm on t.MarketingId=pm.Id and pm.Placed=0
	union all
	select t.*,null as ProjectStartDt,0 as TotCompensation,null as HourlyRate,null as TotconsultingFee from @temp t
	) as a order by pName
end
else if(@Flag=2)
begin	
	select t.*,pm.ProjectStartDt,0 as TotCompensation,pm.HourlyRate,(pm.HourlyRate*80) as TotconsultingFee from @temp t
	inner join ProfileMarketing pm on t.MarketingId=pm.Id and pm.Placed=1 order by pName
end
else 
begin
	select t.*,pm.ProjectStartDt,0 as TotCompensation,pm.HourlyRate,(pm.HourlyRate*80) as TotconsultingFee from @temp t
	left join ProfileMarketing pm on t.MarketingId=pm.Id order by pName
end

end
GO


