FirstDayShowup,SecondDayShowup,ThirdDayShowup,FouthDayShowup,FifthDayShowup,SixthDayShowup,SeventhDayShowup,EightDayShowup,NinthDayShowup,TenthDayShowup,
case when e.Profile_users_PID is not null then 'Yes' else 'No' end AppreadinEvaluation,
e.Result,isnull(e.Selected,0) as SelectedInEvaluation,r.Reason,
'AttendenceAfterEvaluation (Present)'=(select count(*) from TraineeAttendance ta where ta.ProfileId=pu.PID and ta.Absent=0),
