	DROP PROCEDURE[dbo].[GetTrainingCourses]
GO

CREATE PROCEDURE [dbo].[GetTrainingCourses] 
              
as              
begin              
              
select TC.TrainingCourseID, TC.TrainingCourseName, TC.StartDate1, TC.FirstPayment, TC.SecondPayment, TC.Price, TC.IsActive, TC.ImgName, COUNT(DISTINCT WUT.WebsiteUserID) TotalEnrolled, CONCAT(TC.TrainingCourseName,' ',TC.StartDate1) as TrainingCourseDate

from WebsiteUserTraining WUT

INNER JOIN TrainingCourses TC ON TC.TrainingCourseID = WUT.TrainingCourseID


GROUP BY TC.TrainingCourseID, TC.TrainingCourseName, TC.StartDate1, TC.FirstPayment, TC.SecondPayment, TC.Price, TC.IsActive, TC.ImgName

UNION

select TC.TrainingCourseID, TC.TrainingCourseName, TC.StartDate1, TC.FirstPayment, TC.SecondPayment, TC.Price, TC.IsActive, TC.ImgName, 0 TotalEnrolled, CONCAT(TC.TrainingCourseName,' ',TC.StartDate1) as TrainingCourseDate

FROM TrainingCourses TC

WHERE TrainingCourseID NOT IN (select WUT.TrainingCourseID from WebsiteUserTraining WUT) 


ORDER BY TC.TrainingCourseID DESC 
              
end
GO


