-- Procedure structure for GetTrainingResources
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[GetTrainingResources]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[GetTrainingResources]
GO

CREATE PROCEDURE [dbo].[GetTrainingResources]  (@trainingID INT)
              
as              
begin              
              
select tr.TrainingResourcesID,tr.TrainingCourseID,tr.Type,tr.Path,tr.BackupPath,tr.SessionN,tr.DateRecord,tr.CreatedBy,tr.OriginalFileName,tr.FileSize,tr.FileExtension, 'Demo Session' SessionTitle, GETDATE() StartDate1

from TrainingResources tr

WHERE tr.TrainingCourseID = @trainingID AND tr.SessionN = 'Session0'

UNION

select tr.TrainingResourcesID,tr.TrainingCourseID,tr.Type,tr.Path,tr.BackupPath,tr.SessionN,tr.DateRecord,tr.CreatedBy,tr.OriginalFileName,tr.FileSize,tr.FileExtension, ts.SessionTitle, tc.StartDate1 StartDate1

from TrainingResources tr

INNER JOIN TrainingSession ts on ts.TrainingCourseID = tr.TrainingCourseID

INNER JOIN TrainingCourses tc on tc.TrainingCourseID = tr.TrainingCourseID


WHERE tr.TrainingCourseID = @trainingID AND REPLACE(tr.SessionN, 'Session', '')  =  ts.SessionID

ORDER BY SessionN
              
end
GO


