CREATE PROCEDURE [dbo].[GetTrainingCoursesByName] (@Name varchar(50))
              
as              
begin              
              
select TC.TrainingCourseID, TC.TrainingCourseName, TC.StartDate1, TC.FirstPayment, TC.SecondPayment, TC.Price, TC.IsActive, TC.ImgName, COUNT(DISTINCT WUT.WebsiteUserID) TotalEnrolled

